            this.props.object.forEach((tab,index)=> {
                tabs[index] = tab.tabname
            })
        }
        return (
                <ul class="tabs">
                    <li data-tab-target="#primary" className="active tab"><InboxTwoToneIcon className="tab-icons"/>Primary</li>
